// pages/Projects.js
import React, { useState } from 'react';
import { FaTimes, FaGithub } from 'react-icons/fa';
import { projects } from '../data';

function ProjectDrawer({ project, isOpen, onClose }) {
  if (!project) return null;
  return (
    <div className={`fixed inset-0 z-50 flex justify-end transition-transform duration-300 ${isOpen ? 'translate-x-0' : 'translate-x-full'}`}>
      <div className="w-full max-w-md bg-gray-900 text-purple-100 shadow-xl overflow-auto">
        <div className="flex justify-between items-center p-4 border-b border-gray-700">
          <h2 className="text-xl font-bold">{project.title}</h2>
          <button onClick={onClose} className="text-purple-300 hover:text-white">
            <FaTimes size={20} />
          </button>
        </div>
        <div className="p-6">
          {project.longDescription && <p className="mb-4">{project.longDescription}</p>}

          {project.images?.length > 0 && (
            <div className="grid grid-cols-1 gap-4 mb-4">
              {project.images.map((src, i) => (
                <img key={i} src={src} alt={`${project.title} screenshot ${i+1}`} className="rounded" />
              ))}
            </div>
          )}

          <h4 className="font-semibold mb-2">Technologies</h4>
          <div className="flex flex-wrap gap-2 mb-4">
            {project.technologies?.map((tech) => (
              <span key={tech.name} className="bg-purple-200 text-gray-900 px-2 py-1 rounded text-xs">
                {tech.name}
              </span>
            ))}
          </div>

          <div className="flex gap-4">
            {project.github && (
              <a href={project.github} target="_blank" rel="noopener noreferrer" className="inline-flex items-center">
                <FaGithub className="mr-1" /> Code
              </a>
            )}
            {project.link && (
              <a href={project.link} target="_blank" rel="noopener noreferrer">
                Live Demo
              </a>
            )}
          </div>
        </div>
      </div>
    </div>
  );
}

export default function Projects() {
  const [activeTab, setActiveTab] = useState('completed');
  const [selectedProject, setSelectedProject] = useState(null);

  const completed = projects.filter(p => p.status === 'completed');
  const school = projects.filter(p => p.category === 'School');

  const handleOpen = project => setSelectedProject(project);
  const handleClose = () => setSelectedProject(null);

  return (
    <section id="projects" className="bg-gray-900 text-purple-100 p-10">
      <div className="flex justify-center mb-8">
        {['completed', 'school'].map(tab => (
          <button
            key={tab}
            onClick={() => setActiveTab(tab)}
            className={`mx-2 px-4 py-2 rounded-lg font-bold ${activeTab === tab ? 'bg-purple-200 text-gray-900' : 'bg-gray-800 text-purple-100'}`}
          >
            {tab === 'completed' ? 'Projects' : 'School'}
          </button>
        ))}
      </div>

      <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-8">
        {(activeTab === 'completed' ? completed : school).map(project => (
          <div
            key={project.slug}
            className="p-6 bg-gray-800 rounded-lg shadow-lg cursor-pointer hover:shadow-2xl transition-shadow"
            onClick={() => handleOpen(project)}
          >
            <h3 className="text-xl font-semibold mb-2">{project.title}</h3>
            <p className="text-sm text-purple-300">{project.subtitle || `${project.description.substring(0, 80)}...`}</p>
          </div>
        ))}
      </div>

      <ProjectDrawer project={selectedProject} isOpen={!!selectedProject} onClose={handleClose} />
    </section>
  );
}
